import React from 'react';
import './Contato.css';

const Contato = () => {
    return (
        <section id="contato" className="contato">
            <p>Entre em contato para discutir seu projeto ou para conhecer mais sobre minha trajetória.</p>
            <h2>Contatos</h2>
            <ul>
                <li>Email: <a href="mailto:monisesilva91@hotmail.com">monisesilva91@hotmail.com</a></li>
                <li>Telefone: <a href="https://wa.me/5514991178404" className="cta-botao">Fale no WhatsApp</a></li>
                <li>LinkedIn: <a href="https://www.linkedin.com/in/monisesilva" target="_blank" rel="noopener noreferrer">LinkedIn</a></li>
                <li>Instagram: <a href="https://www.instagram.com/monisesilva" target="_blank" rel="noopener noreferrer">Instagram</a></li>
                <li>GitHub: <a href="https://github.com/usuario" target="_blank" rel="noopener noreferrer">GitHub</a></li>
                <li><a href="curriculo.pdf" className="cta-botao" download>Download Currículo</a></li>
            </ul>
        </section>
    );
};

export default Contato;
